import React, { useState, useEffect } from "react";
import './dcss.css';
import axios from 'axios';
import lt from './images/leetcode.png';
import retrieve from './retrieve.js';
import { Link} from 'react-router-dom';


const MyComponent = () => {
    const [data, setData] = useState(null);
    const [error, setError] = useState(null);
    const username = sessionStorage.getItem('username');
    const uid = 'tponsankar';
    const url = 'https://codechef-api.vercel.app/' + uid;
  
    const fetchData = async (dataType) => {
      try {
        const response = await fetch(url);
        if (!response.ok) {
          throw new Error(`Error fetching data: ${response.status}`);
        }
        const fetchedData = await response.json();
        // Extract specific data based on dataType
        let extractedData;
        switch (dataType) {
          case 'total':
            extractedData = fetchedData; // Assuming total solved is the entire data object
            break;
          case 'easy':
            // Extract data for easy problems based on the API structure
            extractedData = fetchedData.easySolved; // Replace with actual property name
            break;
          case 'medium':
            // Extract data for medium problems based on the API structure
            extractedData = fetchedData.mediumSolved; // Replace with actual property name
            break;
          case 'hard':
            // Extract data for hard problems based on the API structure
            extractedData = fetchedData.hardSolved; // Replace with actual property name
            break;
          default:
            throw new Error("Invalid data type");
        }
        return extractedData;
      } catch (error) {
        setError(error.message);
      }
    };
  
    useEffect(() => {
      const fetchLeetCodeData = async () => {
        const dataTypes = ['total', 'easy', 'medium', 'hard'];
        for (const dataType of dataTypes) {
          const fetchedData = await fetchData(dataType);
          switch (dataType) {
            case 'total':
              setTotalSolved(fetchedData);
              break;
            case 'easy':
              seteasySolved(fetchedData);
              break;
            case 'medium':
              setmediumSolved(fetchedData);
              break;
            case 'hard':
              sethardSolved(fetchedData);
              break;
          }
        }
      };
  
      fetchLeetCodeData();
    }, []);


  return (
    <div>
      <meta charSet="UTF-8" />
        <meta name="viewport" content="width=device-width, initial-scale=1.0" />
        {/* displays site properly based on user's device */}
        <link rel="icon" type="image/png" sizes="32x32" href="./images/favicon-32x32.png" />
        <title>Statista</title>
        {/* Google Fonts */}
        <link rel="preconnect" href="https://fonts.googleapis.com" />
        <link rel="preconnect" href="https://fonts.gstatic.com" crossOrigin />
        <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;700&display=swap" rel="stylesheet" />
        <link rel="stylesheet" href="styles.css" />
        {/* Feel free to remove these styles or customise in your own stylesheet üëç */}
        <style dangerouslySetInnerHTML={{__html: "\n      .attribution {\n        font-size: 11px;\n        text-align: center;\n      }\n      .attribution a {\n        color: hsl(228, 45%, 44%);\n      }\n    " }} />
        <header className="header container">
        
          <div className="header__title">
            <h1>Statista</h1>
            <Link to ='/' >
           <center><button type="Submit" className="bu">Log-out</button></center></Link>
          </div>
          
        </header>
        <main>
          <section className="container cards">
            <div className="card card--facebook">
              <div className="card__platform">
                <img className="card__icon" src={lt} alt="Leetcode" />
                <div className="card__username">@{uid}</div>
              </div>
              <div className="card card--facebook">
        <div className="card__followers">
          <div className="card_count card_count--big">
            {error ? error : totalSolved}{/* Display error or fetched data */}
          </div>
          <div className="card__label">Total Solved</div>
        </div>
      </div>
            </div>
            <div className="card card--twitter">
              <div className="card__platform">
                <img className="card__icon" src={lt} alt="Leetcode" />
                <div className="card__username">@{uid}</div>
              </div>
              <div className="card card--twitter">
              <div className="card__followers">
                <div className="card_count card_count--big">{error ? error : easySolved}{retrieve} {/* Display error or fetched data */}</div>
                <div className="card__label">Easy Solved</div>
              </div>
              </div>
            </div>
            <div className="card card--instagram">
              <div className="card__platform">
                <img className="card__icon" src={lt} alt="Leetcode" />
                <div className="card__username">@{uid}</div>
              </div>
              <div className="card card--instagram">
              <div className="card__followers">
                <div className="card_count card_count--big">{error ? error : mediumSolved}{retrieve} {/* Display error or fetched data */}</div>
                <div className="card__label">Medium Solved</div>
              </div>
              </div>
            </div>
            <div className="card card--youtube">
              <div className="card__platform">
                <img className="card__icon" src={lt} alt="Leetcode" />
                <div className="card__username">@{uid}</div>
              </div>
              <div className="card card--instagram">
              <div className="card__followers">
                <div className="card_count card_count--big">{error ? error : hardSolved}{retrieve} {/* Display error or fetched data */}</div>
                <div className="card__label">Hard Solved</div>
              </div>
            </div>
            </div>
          </section>
  
        </main>
    </div>

  );
}
